function About() {
  return (
    <>
      <div style={{marginTop:'5rem',width:'100%',height:'10px'}} className="about-scroll"></div>

      <div className="container about">

          <h2 className="main-title about-h2 text-center">ABOUT</h2>
            <p className="main-p text-center">
            Our team goes out of their way to satisfy the needs of our clients and they personally ensure that our clients are happy with the final output.

              We at Eternal are always keen on staying on the top of our game. Hence we have a dedicated in-house team of research experts who are constantly looking out for new updates and come up with a new approach to our marketing tactics.
            </p>
            <div className="text-center">
            <img alt="about" src="../img/img1.png" className="img-fluid" />

          </div>
        </div>

    </>
  );
}
export default About;
